var Minimatch=require("../minimatch.js").Minimatch,tap=require("tap");tap.test("cache test",function(e){var n=new Minimatch("a?b"),t=new Minimatch("a?b");e.equal(n,t,"should get the same object");for(var r=0;100>r;r++)new Minimatch("a"+r);t=new Minimatch("a?b"),e.notEqual(n,t,"cache should have dropped"),e.end()});